import React, { Component } from 'react';

class Like extends Component {
    render() {
        const {movie, onLike} = this.props;
        console.log(movie); 
        return ( 
            <i className={this.props.liked ? "fa fa-heart" : "fa fa-heart-o"} aria-hidden="true" />
         );
    }
}
 
export default Like;
